// Import Assets
import profile from '../assets/profile.png';

const About = () => {
    return (
        <section className='about'>
            <h2>About Me</h2>
            <p>
                A Master's student at ESIEE PARIS in Artificial Intelligence and Cybersecurity. Passionate aboute software engineering and crypto industry. Independant, self-sufficient and ability to learn quickly in a dynamic industry.
            </p>
        </section>
    );
}

export default About;
